  finished = false,
  reading_scoreboard = true,
  read_cooldown = 0,
  scoreboard_offset = 0,
  scoreboard_total_rows = 0,
  scoreboard = {
    start = 0,
    you = 0,
    lobby = 1,
    friends = 2,
    top = 3,
    count = 4
  },
  scoreboard_type = 2,
  num_rows_filled = 0,
  num_rows = 20,
  rows_id = {},
