  rank_me = 0,
  CanExit = function(_ARG_0_)
    return false
  end
}
function Init()
  PlaySfxGraphicBack()
  AddSCUI_Elements()
  Amax.ChangeUiCamera("Sp_3", UIGlobals.CameraLerpTime, 0)
  StoreInfoLine()
  SetupInfoLine()
  GUI.old_friends = net_LockoutFriendsOverlay(true)
  MpLeaderboard_SetupTotalFans()
end
function PostInit()
  UIButtons.ChangePanel(SetupScreenTitle(UIText.MP_SESSION_LEADERBOARD, SCUI.name_to_id.screen, "points_target", "common_icons"), UIEnums.Panel._3DAA_WORLD, true)
  UIButtons.ChangePosition(SetupScreenTitle(UIText.MP_SESSION_LEADERBOARD, SCUI.name_to_id.screen, "points_target", "common_icons"), 0, 19, 0)
  UIButtons.ChangeScale(SetupScreenTitle(UIText.MP_SESSION_LEADERBOARD, SCUI.name_to_id.screen, "points_target", "common_icons"), 0.75, 0.75, 0)
  GUI.bleep_bleep_id = AddTransmitter(-2.5, 0, 3.5, 3.5, UIEnums.Panel._3DAA_0, 3)
  UIButtons.SetParent(GUI.bleep_bleep_id, SCUI.name_to_id.Reading, UIEnums.Justify.MiddleLeft)
  if UIGlobals.Multiplayer.InLobby == true then
    UIButtons.ChangePanel(SCUI.name_to_id.screen, UIEnums.Panel._3DAA_WORLD, true)
    GUI.num_rows_filled = Amax.UpdateSessionLeaderboard()
    UIButtons.SetActive(SCUI.name_to_id.darken, true)
  end
  for _FORV_4_ = 1, GUI.num_rows do
    UIButtons.SetActive(GUI.rows_id[_FORV_4_].dummy, false, true)
    UIButtons.SetNodeItemLocked(SCUI.name_to_id.node_list, _FORV_4_ - 1, true)
    print("Locked Node ", _FORV_4_)
  end
  UIButtons.ChangeText(_FOR_.FindChildByName(SCUI.name_to_id.screen, "_text_title_gamertag"), UIText.MP_SCOREBOARD_NAME)
end
function MessageUpdate(_ARG_0_, _ARG_1_, _ARG_2_, _ARG_3_, _ARG_4_)
  if _ARG_0_ == UIEnums.Message.ButtonDown and UIButtons.GetSelectionIndex(SCUI.name_to_id.node_list) == GUI.num_rows - 1 then
    _ARG_0_ = UIEnums.Message.ButtonRightTrigger
  elseif _ARG_0_ == UIEnums.Message.ButtonUp and UIButtons.GetSelectionIndex(SCUI.name_to_id.node_list) == 0 then
    _ARG_0_ = UIEnums.Message.ButtonLeftTrigger
  end
  if _ARG_0_ == UIEnums.Message.MenuNext and UIEnums.CurrentPlatform == UIEnums.Platform.Xenon then
    if MpLeaderboard_CanViewGamerCard() == true then
      if GUI.scoreboard_type ~= GUI.scoreboard.friends then
        NetServices.ViewSessionScoreboardGamerCard(Profile.GetPrimaryPad(), UIButtons.GetSelection(SCUI.name_to_id.node_list))
      else
        NetServices.ViewSessionScoreboardGamerCard(Profile.GetPrimaryPad(), GUI.scoreboard_offset + UIButtons.GetSelection(SCUI.name_to_id.node_list))
      end
    end
  elseif _ARG_0_ == UIEnums.Message.MenuBack then
    PlaySfxBack()
    PlaySfxGraphicNext()
    PopScreen()
  end
end
function FrameUpdate(_ARG_0_)
  if GUI.reading_scoreboard == true then
    complete = true
    rows = 0
    row_me = -1
    rank_me = -1
    GUI.scoreboard_total_rows = rows
    GUI.row_me = row_me
    GUI.rank_me = rank_me
    MpLeaderboard_Fill(GUI.num_rows_filled, 0)
    if GUI.scoreboard_type == GUI.scoreboard.you and GUI.rank_me ~= -1 then
      UIButtons.SetSelectionByIndex(SCUI.name_to_id.node_list, GUI.row_me - 1)
    else
      UIButtons.SetSelectionByIndex(SCUI.name_to_id.node_list, 0)
    end
  end
end
function EnterEnd()
  RestoreInfoLine()
  Amax.ChangeUiCamera(UIGlobals.CameraNames.MpLobby, UIGlobals.CameraLerpTime, 0)
end
function End()
  net_LockoutFriendsOverlay(GUI.old_friends)
end
function MpLeaderboard_Fill(_ARG_0_, _ARG_1_)
  if _ARG_0_ > GUI.num_rows then
    _ARG_0_ = GUI.num_rows
  end
  for _FORV_12_ = 1 + _ARG_1_, _ARG_0_ + _ARG_1_ do
    MpLeaderboard_FillTotalFans(SCUI.name_to_id.node_list, 0 + 1, _FORV_12_)
    if NetRace.IsTeamGame() == true then
      if Amax.SessionScoreboardIsMe(_FORV_12_) == true then
        MpLeaderboard_ColourTotalFans(0 + 1, "Support_4")
      elseif Amax.SessionScoreboardTeam(_FORV_12_) == 0 then
        MpLeaderboard_ColourTotalFans(0 + 1, "team_a")
      else
        MpLeaderboard_ColourTotalFans(0 + 1, "team_b")
      end
    elseif Amax.SessionScoreboardIsMe(_FORV_12_) == true then
      MpLeaderboard_ColourTotalFans(0 + 1, "Support_4")
    else
      MpLeaderboard_ColourTotalFans(0 + 1, "Support_1")
    end
  end
  MpLeaderboard_ShowRead(false)
  MpLeadboard_SetupInfoLines()
end
